window.bookSummaryJSON = "<p>Supernatural creatures create chaos across an unforgiving western landscape in the first audiobook of a propulsive and cinematic fantasy adventure starring ever&nbsp;fearless Nettie Lonesome.</p> <p>Nettie Lonesome dreams of a greater life than toiling as a slave in the sandy desert. But when a stranger attacks her, Nettie wins more than the fight.</p> <p>Now she's got friends, a good horse, and a better gun. But if she can't kill the thing haunting her nightmares and stealing children across the prairie, she'll lose it all - and never find out what happened to her real family.</p> <p><b>The Shadow</b></p> <ul> <li><i>Wake of Vultures</i></li> <li><i>Conspiracy of Ravens</i></li> <li><i>Malice of Crows</i></li> <li><i>Treason of Hawks</i></li> </ul>"; 
